control.onControlLoad:
              //鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 11; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 11; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.codeEpc = g5.dataset1.getData(8, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");


//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" + 
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([prodName] like '%" + db.encode(searchText) + "%') or " +
        "([manufact] like '%" + db.encode(searchText) + "%') or " + 
        "([produceDate] like '%" + db.encode(searchText) + "%') or " +
        "([validDate] like '%" + db.encode(searchText) + "%') or " +
        "([batch] like '%" + db.encode(searchText) + "%') or " +
        "([sn] like '%" + db.encode(searchText) + "%') or " + 
        "([position] like '%" + db.encode(searchText) + "%') or " + 
        "([codeEpc] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM [unionCode] " +
    "WHERE ([status] <> 'DEL') "+  condition 

sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT *,'<span style=\"color:blue;\">查看详情</span>' as watchDetails,'<span style=\"color:blue;\">点击查看</span>' as clickWatch from unionCode "+
    "WHERE (status <> 'DEL') "+ condition +
    "ORDER BY id DESC ";  
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 


eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,positionID,prodName,manufact,produceDate,validDate,batch,sn,codeEpc,watchDetails,clickWatch", pageSize*(pageCurrent-1), pageSize);

